/// <summary>
/// Gets or sets the value from the buffer for a given <c>InventDimension</c> class.
/// </summary>
/// <param name = "_dimensionClassName">The name of the <c>InventDimension</c> class.</param>
/// <param name = "_value">The value to set.</param>
/// <returns>The dimension's value.</returns>
protected anytype parmInventoryDimensionValue(ClassName _dimensionClassName, anytype _value = null)
{
    FieldId fieldId = SalesInvoiceTmp::inventoryDimensionFieldId(_dimensionClassName);

    if (!prmIsDefault(_value))
    {
        this.(fieldId) = _value;
    }

    return this.(fieldId);
}

/// <summary>
/// Returns the field Id for a given <c>InventDimension</c> class.
/// </summary>
/// <param name = "_dimensionClassName">The name of the <c>InventDimension</c> class.</param>
/// <returns>The field Id.</returns>
static protected FieldId inventoryDimensionFieldId(ClassName _dimensionClassName)
{
    return InventDimFieldsMap::fieldIdForDimensionOnMappedTable(_dimensionClassName, tableStr(SalesInvoiceTmp));
}

/// <summary>
/// Returns the field Id of the corresponding flag for a given <c>InventProductDimension</c> class.
/// </summary>
/// <param name = "_productDimension">The instance of the <c>InventProductDimension</c> class.</param>
/// <returns>The field Id.</returns>
public static FieldId productDimensionFlagFieldId(InventProductDimension _productDimension)
{
    #InventDimDevelop

    switch (true)
    {
        case _productDimension is InventProductDimensionConfig:
            return fieldNum(SalesInvoiceTmp, ConfigIdFlag);
        case _productDimension is InventProductDimensionSize:
            return fieldNum(SalesInvoiceTmp, InventSizeIdFlag);
        case _productDimension is InventProductDimensionColor:
            return fieldNum(SalesInvoiceTmp, InventColorIdFlag);
        case _productDimension is InventProductDimensionStyle:
            return fieldNum(SalesInvoiceTmp, InventStyleIdFlag);
        case _productDimension is InventProductDimensionVersion:
            return fieldNum(SalesInvoiceTmp, InventVersionIdFlag);
    }
    return 0;
}

/// <summary>
/// Determines if concurrent deletes should throw exception.
/// </summary>
/// <returns>true if exception should be thrown; otherwise false.</returns>
public boolean shouldThrowExceptionOnZeroDelete()
{
    return super() || SalesEnforceConcurrentDeletesFlight::instance().isEnabled();
}
